import React, { useState } from 'react';
import { Slider } from 'rsuite';

const PercentageSlider = () => {
  const [value, setValue] = useState(0);

  const handleChange = (value) => {
    setValue(value);
  };

  return (
    <div style={{ width: '80%', margin: '0 auto', textAlign: 'center' }}>
      <div style={{ fontSize: '26px', marginBottom: '20px', position: 'relative', display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
        {value}%
        <img 
          src="https://kairosrainbow.it/wp-content/uploads/2016/11/coins.png" 
          alt="Coin"
          style={{
            width: '30px',
            height: '30px',
            marginLeft: '10px',
          }}
        />
      </div>
      <Slider
        min={0}
        max={100}
        step={5}
        value={value}
        onChange={handleChange}
        graduated
        progress
        style={{
          width: '100%',
          height: '8px',
          borderRadius: '4px',
        }}
        handleStyle={{
          borderColor: '#4CAF50',
          backgroundColor: '#4CAF50',
          width: '20px',
          height: '20px',
        }}
        railStyle={{
          backgroundColor: '#ccc',
        }}
      />
    </div>
  );
};

export default PercentageSlider;
